1Z', 'closed_at': None, 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': 'Related to https://github.com/ampproject/amp-toolbox-php/issues/511

Consider an example snippet like this
```html
<amp-embed
  width="780"
  height="100"
  heights="(max-width:645px) 100%, (max-width:845px) 31%, 23%"
  layout="responsive"
  type="zergnet"
  data-zergid="42658"
></amp-embed>
```
When we use an element with `heights` attribute the SSR or more specifically the `createResponsiveSizer` method in [ApplyLayout.js](https://github.com/ampproject/amp-toolbox/blob/main/packages/optimizer/lib/transformers/ApplyLayout.js#L128) adds an inline `padding-top` in the sizer element. But the SSR also generates amp-custom styles like this,
```html
    <style amp-custom>
      #i-amp-0 > :first-child {
        padding-top: 23%;
      }
      @media (max-width: 845px) {
        #i-amp-0 > :first-child {
          padding-top: 31%;
        }
      }
      @media (max-width: 645px) {
        #i-amp-0 > :first-child {
          padding-top: 100%;
        }
      }
    </style>
    <amp-embed
      width="780"
      height="100"
      layout="responsive"
      type="zergnet"
      data-zergid="42658"
      id="i-amp-0"
      class="i-amphtml-layout-responsive i-amphtml-layout-size-defined"
      i-amphtml-layout="responsive"
      >
       <i-amphtml-sizer slot="i-amphtml-svc" style="display: block; padding-top: 12.8205%"></i-amphtml-sizer>
    </amp-embed>
```
For this output, the browser will always use the inline padding instead of the padding declared in amp-custom style. Hence, the generated markup is not responsive as expected. 

In addition to that, according to the [source code of amphtml](https://github.com/ampproject/amphtml/blob/main/src/custom-element.js#L1076), when we simply use the non-SSR element, it adds an inline padding-top using the `heights` attribute value. There is no affect of height/width ratio here. It only works if there is a `heights` attribute.

So, from my observation, we should remove the inline `padding-top` and only use the amp-custom style generated by the `heights` attribute value to get a responsive sizer.', 'reactions': {'url': 'https://api.github.com/repos/ampproject/amp-toolbox/issues/1314/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/ampproject/amp-toolbox/issues/1314/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/ampproject/amp-toolbox/issues/comments/1099198832', 'html_url': 'https://github.com/ampproject/amp-toolbox/issues/1314#issuecomment-1099198832', 'issue_url': 'https://api.github.com/repos/ampproject/amp-toolbox/issues/1314', 'id': 1099198832, 'node_id': 'IC_kwDOBsUXz85BhHFw', 'user': {'login': 'sebastianbenz', 'id': 380472, 'node_id': 'MDQ6VXNlcjM4MDQ3Mg==', 'avatar_url': 'https://avatars.githubusercontent.com/u/380472?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/sebastianbenz', 'html_url': 'https://github.com/sebastianbenz', 'followers_url': 'https://api.github.com/users/sebastianbenz/followers', 'following_url': 'https://api.github.com/users/sebastianbenz/following{/other_user}', 'gists_url': 'https://api.github.com/users/sebastianbenz/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/sebastianbenz/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/sebastianbenz/subscriptions', 'organizations_url': 'https://api.github.com/users/sebastianbenz/orgs', 'repos_url': 'https://api.github.com/users/sebastianbenz/repos', 'events_url': 'https://api.github.com/users/sebastianbenz/events{/privacy}', 'received_events_url': 'https://api.github.com/users/sebastianbenz/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-14T13:40:31Z', 'updated_at': '2022-04-14T13:40:31Z', 'author_association': 'COLLABORATOR', 'body': 'Good point. Then this leaves onl